import React, {useState, useEffect} from 'react'

const data = require('../../assets/data/products.json');


const ProductContainer = () => {
    const [products, setProducts] = useState([]);

    useEffect(() =>{
        setProducts(data);
    })
  return (
    <View>
      <Text>Blah blah blah</Text>
    </View>
  )
}

export default ProductContainer
